// src/components/RegistrationPage.js
import React, { useState } from 'react';
import AuthPage from './AuthPage';

import { useNavigate } from 'react-router-dom';
import {
  Button,
  TextField,
  Typography,
  Container,
  Grid,
  Box,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from '@mui/material';

const RegistrationPage = () => {
  const navigate = useNavigate();

  const [registrationType, setRegistrationType] = useState('');
  const [registrationDetails, setRegistrationDetails] = useState({
    name: '',
    email: '',
    phoneNumber: '',
    aadharNumber: '',
    password: '', // Added password field
  });

  const [error, setError] = useState({
    email: false,
    phoneNumber: false,
    aadharNumber: false,
    password: false, // Added password error state
  });

  const handleRegistrationTypeChange = (event) => {
    setRegistrationType(event.target.value);
  };

  const handleRegistrationDetailsChange = (field, value) => {
    let isValid = true;

    if (field === 'email') {
      // Validate email format
      isValid = /\S+@\S+\.\S+/.test(value);
    } else if (field === 'phoneNumber' || field === 'aadharNumber') {
      // Validate phone number and Aadhar number format
      isValid = /^\d{10,12}$/.test(value);
    } else if (field === 'password') {
      // Validate password (you can add your own validation logic)
      isValid = value.length >= 6; // For example, require at least 6 characters
    }

    // Update the error state
    setError((prevError) => ({
      ...prevError,
      [field]: !isValid,
    }));

    setRegistrationDetails((prevDetails) => ({
      ...prevDetails,
      [field]: value,
    }));
  };

  const handleRegister = () => {
    // Simulate saving registration details to a database
    console.log('Registration Details:', registrationDetails);
    // Redirect to the login page after successful registration
    navigate('/');
  };

  return (
    <Container component="main" maxWidth="xs">
      <Box
        sx={{
          marginTop: 8,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
        }}
      >
        <Typography component="h1" variant="h5">
          Register
        </Typography>
        <Box
          component="form"
          noValidate
          sx={{
            width: '100%',
            marginTop: 1,
          }}
        >
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <FormControl fullWidth>
                <InputLabel id="registration-type-label">Registration Type</InputLabel>
                <Select
                  labelId="registration-type-label"
                  id="registration-type"
                  value={registrationType}
                  label="Registration Type"
                  onChange={handleRegistrationTypeChange}
                >
                  <MenuItem value="contractor">Contractor</MenuItem>
                  <MenuItem value="subcontractor">Worker</MenuItem>
                </Select>
              </FormControl>
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="Full Name"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.name}
                onChange={(e) => handleRegistrationDetailsChange('name', e.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="Email"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.email}
                onChange={(e) => handleRegistrationDetailsChange('email', e.target.value)}
                error={error.email}
                helperText={error.email ? 'Enter a valid email address' : ''}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="Phone Number"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.phoneNumber}
                onChange={(e) => handleRegistrationDetailsChange('phoneNumber', e.target.value)}
                error={error.phoneNumber}
                helperText={error.phoneNumber ? 'Enter a valid 10-digit phone number' : ''}
                inputProps={{ maxLength: 10 }}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="Aadhar Number"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.aadharNumber}
                onChange={(e) => handleRegistrationDetailsChange('aadharNumber', e.target.value)}
                error={error.aadharNumber}
                helperText={error.aadharNumber ? 'Enter a valid 12-digit Aadhar number' : ''}
                inputProps={{ maxLength: 12 }}
              />
            </Grid>
            <Grid item xs={12}>
              {/* Password Field */}
              <TextField
                label="Password"
                type="password"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.password}
                onChange={(e) => handleRegistrationDetailsChange('password', e.target.value)}
                error={error.password}
                helperText={error.password ? 'Password must be at least 6 characters' : ''}
              />
            </Grid>
            <Grid item xs={12}>
              {/* File Upload for Aadhar Card Photo */}
              <input type="file" accept="image/*" />
            </Grid>
            <Grid item xs={12}>
              <Button variant="contained" fullWidth onClick={handleRegister}>
                Register
              </Button>
            </Grid>
          </Grid>
        </Box>
      </Box>
    </Container>
  );
};

export default RegistrationPage;
